window.bookSummaryJSON = "<p><b>Don’t fall for your coworker...especially when he’s your roommate.</b></p> <p>Sutton Barnes thinks he’s prince charming, but he’s really the prince of hell. He’s egotistical. A user. A complete douchecanoe. And unfortunately now my coworker.</p> <p>Did I mention he’s also my new roommate?</p> <p>It’s all because I can’t turn down a challenge. I never have, and I won’t start now. When Sutton bets me I can’t live in the same apartment as him and resist the “temptation”...well, game on. He’ll be the first to cave. There is no way I’m falling for his charm...not again.</p>"; 
